// src/index.js
import React from 'react';
import ReactDOM from 'react-dom';
import App from './App'; // Adjust the import based on your project structure

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
